import React, { Component } from "react";

class ListMenu extends Component {
  render() {
    return (
      <div class="card" style={{ width: "18rem" }}>
        <div class="card-body">
          <p class="card-text">CHOOSE ROBOT TYPE</p>
        </div>
      </div>
    );
  }
}

export default ListMenu;
